import Link from "next/link";

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
    <Link href="/chat">
      <a style={linkStyle}>Chat</a>
    </Link>
    <Link href="/signup">
      <a style={linkStyle}>Signup</a>
    </Link>
  </div>
);

export default Header;
